    <div className='AddEmployeeContainer' >
      <div className='AddEmployeeForm'>
        <div className='AddEmployeeLeft'>
          <form className='AddEmployeeFormContainer' >
            <h1 className='AddEmployeeFormHeading'>ADD NEW EMPLOYEE</h1>
            <input type="text"
              placeholder="Name"
              name="name"
              className='AddEmployeeInput'
              value={values.name}
              onChange = {(e) => setValues({...values, name:e.target.value})}
            />
            <input type="text"
              placeholder="Username"
              name="username"
              className='AddEmployeeInput'
              value={values.username}
             onChange = {(e) => setValues({...values, username: e.target.value})}
            />
            <input type="email"
              placeholder="Email"
              name="email"
              className='AddEmployeeInput'
              value={values.email}
              onChange = {(e) => setValues({...values, email: e.target.value})}
            />

            <input type="number"
              placeholder="Contact Number"
              name="phone"
              className='AddEmployeeInput'
             value={values.phone}
             onChange= {(e) => setValues({...values, phone: e.target.value})}
            />
            <button className='AddFromLeftButton' onClick={handleAddEmployee}>Add</button>
          </form>
        </div>
      </div>
    </div>
  )
}

export default AddEmployee
